import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { MenuComponentComponent } from './shared/menu-component/menu-component.component';
import { RegisterContainerComponent } from './register-container/register-container/register-container.component';
import { Responsive1ComponentComponent } from './shared/responsive1-component/responsive1-component.component';
import { Responsive2ComponentComponent } from './shared/responsive2-component/responsive2-component.component';

@NgModule({
  declarations: [
    AppComponent,
    MenuComponentComponent,
    RegisterContainerComponent,
    Responsive1ComponentComponent,
    Responsive2ComponentComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [AppComponent],
  exports: [
    MenuComponentComponent
  ]
})
export class AppModule { }
